import React from "react";
import { Link } from "react-router-dom";
import { NavbarData } from "./Navbar-data";

function Navbar() {
  return (
    <header>
      <Link to="/" className="logo">
        Mantul <span>.</span>
      </Link>
      <nav>
        {NavbarData.map((yo, index) => {
          return(
            <Link to={yo.to}>{}</Link>
          )
        })}
      </nav>
    </header>
  );
}

export default Navbar;
